import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';
import { Container, Typography } from '@material-ui/core';

const useStyles = makeStyles({
  table: {
    minWidth: 650,
  },

  Title:{
      textAlign:'center'

  }
});


export default function CitizenDetail({userData}) {
  const classes = useStyles();

  return (
      <Container style={{marginTop:'20px'}}>
    <Typography  className={classes.Title} variant="h4">Property Details</Typography>

    <TableContainer component={Paper}>
      <Table className={classes.table} aria-label="simple table">
        <TableHead>
          <TableRow>
            <TableCell>PTIN</TableCell>
            <TableCell align="right">Owner Name</TableCell>
            <TableCell align="right">Financial Year</TableCell>
            <TableCell align="right">Last_Payment_Date</TableCell>
            <TableCell align="right">Property Type</TableCell>
            <TableCell align="right">House No.</TableCell>
            <TableCell align="right">Zone</TableCell>
            <TableCell align="right">Total_Paid_Amount</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {userData.map((item, i) => (
            <TableRow key={i}>
              <TableCell component="th" scope="row">
                {item.PTIN}
              </TableCell>
              <TableCell align="right">{item.Owner_Name }</TableCell>
              <TableCell align="right">{item.Financial_Year  }</TableCell>
              <TableCell align="right">{item.Last_Payment_Date }</TableCell>
              <TableCell align="right">{item.Property_type   }</TableCell>
              <TableCell align="right">{item.House_No     }</TableCell>
              <TableCell align="right">{item.Zone }</TableCell>
              <TableCell align="right">{item.Total_Paid_Amount }</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
    </Container>
  );
}














